import React from 'react';
import './App.css';
import InputTag from './component/setInput.js';

class  App extends React.Component  {

  getWeather = (e) => {
    e.preventDefault();
    console.log("Hello");
  }

  render() {
    return (
      <div className="App">
        <InputTag methodWeather = {this.getWeather}/>
        <div>
          <h1>Forecast</h1>
          <p>City:</p>
          <p>Temperature:</p>
        </div>
      </div>
    );
  }
}

export default App;
